I1IyspcXZkAMVboiVAh2HJzqJ","defaultExpanded":true,"descriptionCollapsedLines":3,"showMoreCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1IyspcXZkAMVboiVAh2HJzqJygEEikdMUg==","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CP4BEM2rARgBIhMI1IyspcXZkAMVboiVAh2HJzqJygEEikdMUg==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_EXPANDED"}},{"clickTrackingParams":"CP4BEM2rARgBIhMI1IyspcXZkAMVboiVAh2HJzqJygEEikdMUg==","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-structured-description"}}]}},"showLessCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1IyspcXZkAMVboiVAh2HJzqJygEEikdMUg==","changeEngagementPanelVisibilityAction":{"targetId":"engagement-panel-structured-description","visibility":"ENGAGEMENT_PANEL_VISIBILITY_HIDDEN"}},"attributedDescription":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CP4BEM2rARgBIhMI1IyspcXZkAMVboiVAh2HJzqJSOnD7pmTgvCiDcoBBIpHTFI=","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqay1qTWoxQ2pjMkhMcmRpQldDdXhKNXVKeW9RQXxBQ3Jtc0trRURJRjFLWGNRSnY2dEtTQW8xMnBiU1QwRDJ6YkpEVDZTZ0lUek1tTDZuU0YwMDFYdzFRWFV0Q1VFQUxjZFNMa0tHVW1ZM0tZek5jSXl5R3d3dnVTMG9aUVo5ZHVMRTZlUFlyWG4yb3NhX3gxbU93QQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqay1qTWoxQ2pjMkhMcmRpQldDdXhKNXVKeW9RQXxBQ3Jtc0trRURJRjFLWGNRSnY2dEtTQW8xMnBiU1QwRDJ6YkpEVDZTZ0lUek1tTDZuU0YwMDFYdzFRWFV0Q1VFQUxjZFNMa0tHVW1ZM0tZek5jSXl5R3d3dnVTMG9aUVo5ZHVMRTZlUFlyWG4yb3NhX3gxbU93QQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","target":"TARGET_NEW_WINDOW","nofollow":true}}}},{"startIndex":20 es p/Condies Respiratrias em Dispositivos Mveis por Anlise de udio com IA"}]},"channel":{"simpleText":"Forum da Ps-Graduao em Computao do Paran"},"views":{"runs":[{"text":"23"},{"text":" assistindo agora"}]},"publishDate":{"simpleText":"Transmisso iniciada h 27 minutos"},"channelNavigationEndpoint":{"clickTrackingParams":"CBAQ040EGAQiEwjUjKylxdmQAxVuiJUCHYcnOonKAQSKR0xS","commandMetadata":{"webCommandMetadata":{"url":"/@forppgcpr","webPageType":"WEB_PAGE_TYPE_CHANNEL","rootVe":3611,"apiUrl":"/youtubei/v1/browse"}},"browseEndpoint":{"browseId":"UCDbzZ9YQgF77C1RI_pNx0jQ","canonicalBaseUrl":"/@forppgcpr"}},"channelThumbnail":{"thumbnails":[{"url":"https://yt3.ggpht.com/KpMrcI0yPguHgFjIN11Eb8ZJAhLD9dZonDV8nIgiFHqklHny1KB6wjgHXpup_AbexbEpM0_3sw=s88-c-k-c0x00ffffff-no-rj"}]}}},{"expandableVideoDescriptionBodyRenderer":{"showMoreText":{"accessibility":{"accessibilityData":{"label":"Mostrar mais"}},"simpleText":"...mais"},"showLessText":{"simpleText":"Mostrar menos"},"attributedDescriptionBodyText":{"content":"Ttulo: Projeto SPIRA-BM: Biomarcadores para Condies Respiratrias em Dispositivos Mveis por Anlise de udio com Inteligncia Artificial\n\nAbstract: Descreveremos nesta palestra o projeto SPIRA-BM, que visa desenvolver Biomarcadores para problemas respiratrios usando Inteligncia Artificial em udios coletados de pacientes.  O objetivo geral  o desenvolvimento de conhecimento terico, tcnico e tecnolgico sobre biomarcadores de condies respiratrias, cuja aplicao seja prtica, barata e vivel para a populao brasileira. Utilizando tcnicas de aprendizado de mquina, inteligncia artificial e anlise de udio, vamos investigar biomarcadores  de udio para condies respiratrias como insuficincia respiratria, efeitos do tabagismo, e asma grave.  O projeto visa desenvolver, numa primeira fase,  sistemas de computao mvel que realizem a tarefa de coleta de udio e, cujos dados sero sujeitos a processos de anlise de udio e treinamento de redes neurais; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwjUjKylxdmQAxVuiJUCHYcnOolI6cPumZOC8KINygEEikdMUg==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbWNyTWIxSU5jcTFZSEdLQWp3UDUyZ2U2MlVCQXxBQ3Jtc0tuQ2J1dU1iaS1VZmxiaWpLTUVkc0h6Qk4xaWFYQWtNcnhib3F5SGJUQm4zcWx1akpIUS1DQmEtemtDVVItU0NzOHZVNnBDNnFLaXZURUxFMGt2Q2FNZnJXQmd4Tnh6b3dSdVVSYjdqdURlcS05S2tqWQ\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbWNyTWIxSU5jcTFZSEdLQWp3UDUyZ2U2MlVCQXxBQ3Jtc0tuQ2J1dU1iaS1VZmxiaWpLTUVkc0h6Qk4xaWFYQWtNcnhib3F5SGJUQm4zcWx1akpIUS1DQmEtemtDVVItU0NzOHZVNnBDNnFLaXZURUxFMGt2Q2FNZnJXQmd4Tnh6b3dSdVVSYjdqdURlcS05S2tqWQ\u0026q= ; numa segunda fase, um sistema de aplicao das informaes resultantes do aprendizados sero utilizadas num ambiente clnico, num processo de validao clnica da ferramenta.\n\nApresentaremos a estrutura e motivaes do projeto, resultados obtidos e os prximos passos de pesquisa.\n\nMinibio:\n\nMarcelo Finger  professor titular de Cincia da Computao na Universidade de So Paulo, Brasil, e pesquisador principal do Centro IBM-Fapesp para Inteligncia Artificial (C4AI) da Universidade de So Paulo. Ele possui graduao (1988) em Engenharia Eletrnica pela Universidade de So Paulo, mestrado (1990) e doutorado (1994) em Computao pelo Imperial College London. Seus interesses de pesquisa abrangem Inteligncia Artificial, Lgica e Raciocnio Destrutivo-Probabilstico, Redes Neurais e Lingustica Computacional.  Marcelo  colunista da Rdio Eldorado desde 2023, com um programa semanal de \"Inteligncia Artificial nas Ondas do Rdio\", que vai ao ar todas as 6as feiras, 8h, e est disponvel em podcast.\n\nSite: https://www.ime.usp.br/~mfinger/\n\nModerador: Adolfo Neto (PPGCA UTFPR Curitiba) https://adolfoneto.elixiremfoco.com/","commandRuns":[{"startIndex":1998,"length":32,"onTap":{"innertubeCommand":{"clickTrackingParams":"CBAQ040EGAQiEwjUjKylxdmQAxVuiJUCHYcnOolI6cPumZOC8KINygEEikdMUg==","commandMetadata":{"webCommandMetadata":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXVJWmNCNjEtU2g3TWc1anAtbGszdXZBbWIxd3xBQ3Jtc0trZ0tzWnB1akdDTGNwQkhCUjJJYnEwc3U0UW51NjI3b1FqaDJkZ05pUDFGazZGOUV6bFc3dWE3cXZ2T2EzZDZodkszVi1iNnFSLV9fU2JvZTYyYWxrREFGc1ZNQXFHZ1IzYXJ3aVlxbGoxQnVxMHowNA\u0026q=https%3A%2F%2Fwww.ime.usp.br%2F%7Emfinger%2F\u0026v=DUXAETM7oek","webPageType":"WEB_PAGE_TYPE_UNKNOWN","rootVe":83769}},"urlEndpoint":{"url":"https://www.youtube.com/redirect?event=video_description\u0026redir_token=QUFFLUhqbXVJWmNCNjEtU2g3TWc1anAtbGszdXZBbWIxd3xBQ3Jtc0trZ0tzWnB1akdDTGNwQkhCUjJJYnEwc3U0UW51NjI3b1FqaDJkZ05pUDFGazZGOUV6bFc3dWE3cXZ2T2EzZDZodkszVi1iNnFSLV9fU2JvZTYyYWxrREF
